import React from 'react';

export const Background: React.FC = () => {
  return (
    <div className="relative w-full h-full overflow-hidden grid grid-cols-10 grid-rows-10">
      {Array.from({ length: 100 }, (_, index) => (
        <div
          key={index}
          className={`w-16 h-16 ${index % 2 === 0 ? 'bg-white' : 'bg-black'}`}
        />
      ))}
    </div>
  );
};
